import React from "react";
import "../FormStyles.css";
import "./FormStyles.css";



function CreateProfessionalAccount() {
  return (
    <div className="form-container">
      <div className="form-card">
        <h1>Create Professional Account</h1>
        <form>
          <input type="text" placeholder="Full Name" className="form-input" />
          <input type="text" placeholder="Address Line 1" className="form-input" />
          <input type="text" placeholder="Address Line 2" className="form-input" />
          <input type="email" placeholder="Email Address" className="form-input" />
          <input
            type="password"
            placeholder="Password"
            className="form-input"
          />
          <button className="form-button">Sign up</button>
        </form>
      </div>
    </div>
  );
}

export default CreateProfessionalAccount;
